import React from "react";

function Note(props){
    
    function deleteitem(){
        props.ondelete(props.id);
    }
    return (
            <div className="note" style={{ display: "inline-block", margin: "40px" ,marginLeft:"-10px",marginRight:"10px"}}>
                <h3>{props.title}</h3>
                <p>{props.content}</p>
                <button className="btn" onClick={deleteitem}>Delete</button>
            </div>
    )
}

export default Note;
